class App{
    
    //namespace ProjectMaker;

    private $ProjectsList;

    public function setProjectsList($Directory){
        $this->ProjectsList = $Directory;
    }

    public function main($mvc,$jsonstring,$root){
        $this->saveLog('This is URI: '.$mvc);
        $this->saveLog('This is POST: '.print_r($jsonstring,true));
        $this->saveLog('This is ROOT: '.$root);        
        $mvc = explode('/', $mvc);
        switch($mvc[2]){
            case 'add' :
                $this->saveLog('main->add is runing');
                $this->addNewProject($jsonstring);
                break;
            case 'del' :
                $this->saveLog('main->del is runing');
                $this->deleteProject(ROOT.$jsonstring['projectName']);
                break;
            case 'list' :
                $this->saveLog('main->list is runing');
                $this->listAllProjects($jsonstring,$root);
                break;
             default:
                $this->saveLog('main->default is runing');
                $this->listAllProjects($jsonstring,$root);
                break;
        }
        
    }

    public function getLibs($data){
        switch ($data) {
            case 'bootstrap.min.css':
                return '';
               break;
                    
        }
    }

    public function saveLog($input){
        file_put_contents('log_'.date("d-m-Y").'.log',date("H:i:s").' : '.$input."\n" , FILE_APPEND | LOCK_EX);
    }

    private function newProjectNamingFilter($input){

        return str_replace(array(" ", '"', "'", "&", "/", "\\", "?", "#"), '_', $input);
    }

    public function addNewProject($data){
        //$data = json_decode($data);
        if(!file_exists($this->newProjectNamingFilter($data['projectName']))){
            mkdir(ROOT.$this->newProjectNamingFilter($data['projectName']));
            mkdir(ROOT.$this->newProjectNamingFilter($data['projectName']).'/www-root');
            file_put_contents(ROOT.$this->newProjectNamingFilter($data['projectName']).'/project.json', json_encode($data));
            file_put_contents(ROOT.$this->newProjectNamingFilter($data['projectName']).'/www-root/bootstrap.min.css', base64_decode($this->getLibs('bootstrap.min.css')));
            echo 'success_1';
        } else {
            mkdir(ROOT.$this->newProjectNamingFilter($data['projectName']).'_'.rand(1000,9999));
            file_put_contents(ROOT.$this->newProjectNamingFilter($data['projectName']).'/project.json', json_encode($data));
            echo 'success_2';
        }
    }

    public function deleteProject($dir){
        $this->saveLog('deleteProject->project');
        $files = array_diff(scandir($dir), array('.','..'));
          foreach ($files as $file) {
            (is_dir("$dir/$file")) ? $this->deleteProject("$dir/$file") : unlink("$dir/$file");
          }
          return rmdir($dir);
    }

    public function listAllProjects($data,$root){
        foreach (glob($root."*") as $key => $value) {
            if(is_dir($value)){
