    <script>
        $('#createProject').click(function(){
            var projectEmail = $('#projectEmail').val();
            var projectName = $('#projectName').val();
            var projectAuthor = $('#projectAuthor').val();
            var projectDescription = $('#projectDescription').val();
            var projectSampleData = $('#projectSampleData').val();
            var arr = { projectEmail: projectEmail, projectName: projectName, projectAuthor: projectAuthor, projectDescription: projectDescription, projectSampleData: projectSampleData };
            $.ajax({
                url: 'index.php/add/project/json',
                type: 'POST',
                data: JSON.stringify(arr),
                contentType: 'application/json; charset=utf-8',
                dataType: 'json',
                async: false,
            });
            $('#createNewProject').modal('hide');
            $('#projectsMap').load(document.URL +  ' #projectsMap');
        });

        function deleteProject(id){
            var arr = { projectName: id};
            $.ajax({
                url: 'index.php/del/project/json',
                type: 'POST',
                data: JSON.stringify(arr),
                contentType: 'application/json; charset=utf-8',
                dataType: 'json',
                async: false,
            });
            $('#projectsMap').load(document.URL +  ' #projectsMap');
        }
    </script>
</body>

</html>
